import React from "react";
import { Button } from "@mui/material";
import { Link } from "react-router-dom";

export default class NavbarLogin extends React.Component{
    constructor(props) {
        super(props);
        this.state = {
            authenticated: false,
            registered:false,
            registerpage:false,
            loginpage:true,
            token: null,
            email: "",
            password: "",
            userign: "",
            userFirst: "",
            userLast: "",
            error: "",
        }
    }


    render() {
        return(
            <Link to>
            <Button>
                key="toLogin"
                sx={{ color: 'white', display: 'block', marginLeft: "auto" }}
            >Login</Button></Link>
        )
    }
}
